import React from "react";
import AppBar from "@mui/material/AppBar";
import Typography from "@mui/material/Typography";
import MenuItem from "@mui/material/MenuItem";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import logo from "./images/EZR_Blue.png";
import Banner1 from "./components/Banner1";
import "./App.css";

const pages = ["How it works", "Pricing", "FAQs", "Contact Us", "About"];

function App() {
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };
  return (
    <AppBar position="static">
      <Box
        sx={{
          backgroundColor: "white",
          display: { xs: "flex" },
          justifyContent: "space-between",
          alignItems: "center",
        }}
      >
        <img src={logo} className="App-logo" alt="logo" />
        {pages.map((page) => (
          <MenuItem key={page} onClick={handleCloseNavMenu}>
            <Typography color="#0698d2" textAlign="center" fontSize="20px">
              {page}
            </Typography>
          </MenuItem>
        ))}
        <Button sx={{ backgroundColor: "#0698d2" }}>
          <Typography color="#ffffff" textAlign="center">
            Login/Sign Up
          </Typography>
        </Button>
      </Box>
      <div>
      <Banner1></Banner1>
      </div>
    </AppBar>

  );
}

export default App;
